import { makeStyles } from "@mui/styles";

export const useStyles = makeStyles({
  Pencil: {
    cursor: "url(../pencil.png), auto",
  },
  Pen: {
    cursor: "url(../pen.png), auto",
  },
  Brush: {
    cursor: "url(./brush.png), auto",
  },
  Eraser: {
    cursor: "url(./Assets/cursor/eraser.jpg),auto",
  },
  PaintBucket: {
    cursor: "url(./paintBucket.png), auto",
  },
});
